import React from 'react';
import '../UploadItemPage/UploadItemPage.css';
import { Row, Col, Button } from 'react-bootstrap';

//Components
import {Box} from '../../components/Box/Box.js';

const UploadItemPage = () => {
    return(
        <>
        <Row>
            <Col>
                <Box text="*Upload Page*" />
            </Col>
            <Col>
                <Box text="*testing*" />
            </Col>
        </Row>
        <br></br>
        <Box style={{height: "200px"}} text="*Color Selection / Thickness Selection / Length of time displayed*" />
        <br></br>
        <Box style={{height: "200px"}} text="*Description*" />
        <Button href="/AssignPage">Assigning Video</Button>
        </>
    )
}

export default UploadItemPage;
